import React from 'react';
import image from '../../assets/bg-masthead.jpg'
import classes from './Homepage.module.css'
const Homepage=()=>{
return(
    

     <div className={classes.tag3} >
     <img src={image}/>
     <button className={classes.tag4}>Find Out More</button>
         
     </div>   
   
    
)
}



export default Homepage;
